import React from "react";
import Tilt from "react-parallax-tilt";
import "./Logo.css";

const Logo = () => {
    return (
        <div className="ma4 mt0">
            <Tilt>
                <div className="br2 shadow-2 logo__background">
                    <h1>Logo</h1>
                </div>
            </Tilt>
        </div>
    )
}

export default Logo;
